import { Link } from 'react-router-dom';

const StartPage = () => {
    return (
        <section className="home">
            <div>
                <h1>Are We There, Yeti?</h1>
                <button onClick={() => {<Link to='/game'/>}}>Start Game</button>
            </div>
        </section>
    )
}

export default StartPage;
